import React from 'react'

import PageTemplate from "../Page_Template/PageTemplate"

import {Form, Header} from "semantic-ui-react"


function printSection (section) {
    let entries = Object.entries(section)
    return entries.map((pair)=>{
        return(
            <Form.Group>
                <Form.Input
                    label={pair[0]}
                    disabled
                    value={pair[1]}
                />
            </Form.Group>
        )
    })
}

export default function Preview({form}) {
    return (
        <div>
            <PageTemplate>
                <Header as="h3">
                    Preview Information
                </Header>

                <Header as="h5">General Information</Header>

                   <Form>
                   <div>
                        {printSection(form["general_information"])}
                    </div>
                   </Form>
            </PageTemplate>
        </div>
    )
}
